import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import {Route} from "react-router-dom";
import { Home } from './pages/Home';
import { Iphone } from './pages/Iphone';
import { Ipad } from './pages/Ipad';
import { Macbook } from './pages/Macbook';

class Navibar extends Component {
    render() {
        return (
            <div>
                <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
                    <Container>
                        <Navbar.Brand href="/">OnlyGadget</Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                        <Navbar.Collapse id="responsive-navbar-nav">
                            <Nav className="me-auto">
                                {/* <Nav.Link href="/iphones">IPhone</Nav.Link>
                                <Nav.Link href="/ipads">IPad</Nav.Link>
                                <Nav.Link href="/macbooks">MacBook</Nav.Link>
                                <Nav.Link href="/imac">IMac</Nav.Link>
                                <Nav.Link href="/acc">Аксессуары</Nav.Link> */}
                                <Route path={"/"} element={<Home/>}/>
                                <Route path={"/iphone"} element={<Iphone/>}/>
                                <Route path={"/ipad"} element={<Ipad/>}/>
                                <Route path={"/macbook"} element={<Macbook/>}/>
                            </Nav>
                            <Nav className="cart">
                                <Nav.Link>Корзина</Nav.Link>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </div>
        );
    }
}

export default Navibar;
